import React from 'react'
import '../../src/scripts/jsfx'
import jsfx from '../../src/scripts/jsfx'

function ListItem({title,item,index,jsfx}){
  const [value,setValue] = useState(jsfx.Module[title]["params"][item].D)
  if(item==="Func"){
    return(
      <tr>
      <td key={index}>{item}</td>
      <td style={{textAlign:'right'}}>
        <div class="radio-group">
        <form className='form'>
          {FuncItem}
        </form>
        </div>
        </td>
      </tr>
    );
  }
  else{
    if(jsfx.Module[title]["params"][item]){
      return(
        <tr>
          <td key={index}>{item}</td>
          <td style={{textAlign:'right'}}>
            <input 
              type='range'
              id = {title +"$"+item}  
              min={jsfx.Module[title]["params"][item].L} 
              max={jsfx.Module[title]["params"][item].H} 
              step={(jsfx.Module[title]["params"][item].H - jsfx.Module[title]["params"][item].L) > 10 ? 1 : 0.01} 
              style={{width:170}} 
              name={item}
              value={jsfx.Module[title]["params"][item].D}
              onChange={(ev)=>{
                window.ModifyValue({title: title}, {item: item}, setValue(parseFloat(ev.target.value)));
              }}
              >
            </input>
            </td>
        </tr>
        );
    }
    else{
      return(
        <tr>
          <td key={index}>{item}</td>
          <td style={{textAlign:'right'}}>
            <input 
              type='range' 
              min={0} 
              max={1} 
              step={0.01} 
              style={{width:170}} 
              name={item}
              defaultValue={0}>
            </input>
            </td>
        </tr>
        );
    }
  }
}

